import React from 'react'
import PropTypes from 'prop-types'

function Header() {


  function handleClick(){
    return true
} 

  return (
    <>
   
        <div className='containerBotonesID'>
          <button onClick={handleClick} className="divInline">A</button>
          <button onClick={handleClick} className="divInline">B</button>
          <button onClick={handleClick} className="divInline">C</button>
          <button onClick={handleClick} className="divInline">D</button>
          <button onClick={handleClick} className="divInline">E</button>
        </div>
        <div>

        </div>
        </>
  )
}

Header.defaultProps ={
    text: 'Este es el texto por defecto si no recibo argumentos'
}
Header.propTypes = {
    text: PropTypes.string
}

export default Header
